body:
(28M) I am from Australia, and am on the NDIS but have not used it for the two and a half years I have had it.(diagnosed with schizophrenia, but feel I have more of a psychotic personality organisation/schizophrenia spectrum disorder)

&#x200B;

I see a psychodynamic therapist I pay with my disability pension, and that seems to be going okay. But I am not sure how my issues would be "helped" by the NDIS side of things (they harp on about OT's and support workers, but the OT's I have had got very anxious around me and I got sick of that BS. I have not tried support workers as I don't need laymen around me when it pertains to my life experience/s.)

&#x200B;

I have a very insipid personality, flat affect, essentially the "negative symptoms" of the schizophrenia spectrum. I am very isolated, but see my personality as incompatible with majority of the population.

&#x200B;

I don't really want specific treatments pertaining to me, I just noted my own experience to show one manifesation. I am mostly asking how/if OT can help people with personality deficits/issues.

I have tried to "learn" Hungarian via Duolingo and also Ling, but they don't seem to support the language learning aspects the same as other languages. At least, I was learning Russian for a few months and they supported more "learner friendly" ways of learning the language. Such as breaking the word into syllables and slowly pronouncing the words.

&#x200B;

But the Hungarian versions of these apps seem to just throw you into whole sentences that don't allow you to break the sentence down or play it back slower. And to top it off, the apps I used didn't translate most of the words, it translates the sentence, but not singular words...

&#x200B;

I would like to have a "conversation" with my grandparents in Hungarian, I was thinking learning Serbian, but I don't know if that is disrespectful to them, they were born in Yugoslavia, but speak Hungarian primarily, they can speak Serbian as well. I wanted to learn Serbian as it seems to have more support in the apps and such. But Hungarian is their mother tongue, so I just wanted to know if there are any apps or things of the sort that can teach the Hungarian language.

I am from Australia, and we need yearly referrals to see psychiatrists. I am coming up to the end of the year for my referral some time this month. I have been seeing my psychiatrist for about 4 years now.

&#x200B;

But suddenly in around May, I started having no clue what to say or do pertaining to the referral. I know "make an appointment" is the step, but then what do I say or do? I tell my mum that I don't know what to say, but she doesn't understand, so I don't tell anyone in real life.

&#x200B;

This whole dilemma is making me not want to see my psychiatrist anymore.

&#x200B;

Anyone else have troubles with these kinds of things? You used to be able to do it without thinking about it, but now you have to get every detail, otherwise it doesn't make sense and you feel that you can't do it because it doesn't have a "concrete/steady feeling".

Anyone have issues with latency suddenly? I am from Australia, and I could play with around 70ms, and then suddenly after one of the patches, my latency sits around 300ms?

&#x200B;

I ping google every now and then, and it consistently shows around 35ms-50ms on the .bat file I made, but D4 is lagging with around 300ms...

I'm from Australia and am 27M.

&#x200B;

 I have a schizophrenia spectrum disorder I AM MEDICATED AND DON'T EXPERIENCE HALLUCINATIONS OR DELUSIONS MUCH ANYMORE, and would like to see some one that actually knows about the disorder, I have been in therapy for about 6 years with various professionals, but none have seemed to grasp anything other than "unspecified depression and anxiety" from their expensive schooling. And they only do CBT to top it off. I have other issues that may or may not relate to schizophrenia, but all the professionals care about once I tell them I am diagnosed with schizophrenia is "the voices", WHEN I VERY VERY RARELY EXPERIENCE VOICES. I don't see anyone currently and have not since March.

&#x200B;

I have kind of given up on therapy, even though all the previous psychiatrists and case managers said I need a *clinical psychologist* for long term. But I keep getting gas lit by professionals if I mention that I'd rather see a clinical psychologist than them. They say things like "it doesn't matter what their credentials are!!! :))))))". I saw most of my professionals for about 1.25 years, most of them in the public system. 

&#x200B;

Since no one I can find online specialises in schizophrenia, and don't do another modality other than CBT/DBT/ACT.  I can't go into the public system as I am not as unwell as the people that actually qualify for it, as told by my current psychiatrist and previous psychologist.

&#x200B;

Do I just grit my teeth and go with anyone? I really don't want to do CBT/DBT/ACT, as those are the modalities I did in the past and they didn't do anything, and the literature I have read over the past 5 years says CBT/DBT/ACT is more for active/distressing psychosis, while I don't experience that because of my medication.

I'm from Australia.

&#x200B;

How do you go about filtering out therapists? I have been in therapy for about 6 years with various different professionals and all of them have done CBT/mindfullness/"breathe in, breathe out" basic ass shit.

&#x200B;

I have read about different therapies, like mentalisation, MERIT, metacognitive and narrative. But no one in my area does any of those, and I really don't want to do telehealth, as my internet/phone line is terrible. I'd like to try psychodynamic, but no one seems to do it in my local area, and I don't have the means to go to the city, where everything is in terms of treatment. (I am semi-rural).

&#x200B;

I usually mention "positive symptoms are under control via medications" and then also say "negative symptoms are the real problem for me" and every professional I have seen other than one have all thought "negative symptoms = bad symptoms and positive symptoms = good symptoms"... I'm just going to start leaving unprompted if they don't understand anything about schizophrenia, I'm getting fed up with this shit. They complain that only 30% of people with schizophrenia seek treatment... I wonder why, MAYBE because no one understands basic concepts of schizophrenia, other than "voices" and "the FBI coming to get you", those symptoms can be very distressing, but they only make up like 30%- 40% of the illness.

&#x200B;

I have searched for about 3 years online for "schizophrenia specialists" and nothing pops up at all, just basic CBT bullshit advertisments.

I'm from Australia. I don't really know how to word this, as I didn't have a discussion about it, it was all thrown on me.

&#x200B;

I saw a private psychiatrist when I was about 21, after I had an incident that involved "illusions" of peoples' faces, I never heard anything explicit, they just gave me an antipsychotic on the first visit, a few visits later they sent me to a community mental health team, from the team I never heard an explicit diagnosis. The only time I got an explicit diagnosis was when I was discharged from the team because I aged out after 4 years, and in the letter it said in the diagnoses list schizophrenia and major depression.

&#x200B;

During the entire time I was asking what was up with me, and they mostly replied with "you're smart and handsome" and dodged it. I did get some verbal "it might be this"... "This" being schizotypal PD, avoidant PD, autism, and also schizoid PD. These were all separately said, so it wasn't comorbid from my understanding.

&#x200B;

I have been to hospital about 4 times during my time with the community mental health team, and the diagnoses ranged from OCD, psychotic illness NOS, autism, depression, social anxiety. But it changed each time I went (which is probably normal).

&#x200B;

From what I heard, from my current psychiatrist, who is the original one I saw when I was 21, said "we diagnosed schizophrenia because the meds helped with your symptoms." And they didn't do any tests for any personality issues or anything, it was all speculation. They did the neuropsych test to rule out autism.

This is for sure. And I think we have also with those illness with are no understood by people usually. For example fibromyalgia: I hadn't suffered chronic pain, but I don't think they "made up" his pain, as an important part of common people think.

&#x200B;

PS: I am spanish, sorry for my english. Maybe I mistaken the affirmative/negative sentences of what I write. But I think it's easy to understand it.

In The question, I've written that I need the function in a different component and it's inside the Context. This was not a Rebukes only a normal question, sorry if it sounded rude, English is not my native language. I asked this because from your comment it looked like you didn't read what I was asking, because the code you posted is not even closely related to the question.

You answered what is the difference between:

    setState(() => state);

and

    setState(state);

Which indicates that you didn't in fact read the question.
